    onSubmit(form) {
        if (form.valid) {
            this.isSpinner = true;
            this._text.update_Tax_Information(this.formObj).subscribe((resp) => {
                this.isSpinner = false;
                if (resp.status) {
                    this.toastr.success(resp['message'], 'Success', {
                        timeOut: 5000,
                        positionClass: 'toast-top-right',
                        progressBar: true,
                        progressAnimation: 'increasing'
                    });
                    $('#taxModal').modal('hide');
                }
                else {
                    this.toastr.error(resp['message'], 'Oops!', {
                        timeOut: 5000,
                        positionClass: 'toast-top-right',
                        progressBar: true,
                        progressAnimation: 'increasing'
                    });
                }
            }, (error) => {
                this.isSpinner = false;
                console.log(error);
            });
        }
    }
    // w9 form upload picture
    w9_form_upload(event) {
        var file = event.target.files[0];
        var FileSize = event.target.files[0].size / Math.pow(1024, 2); // in MB
        if (FileSize >= 5) {
            try {
                document.getElementById('W9-form').value = '';
            }
            catch (ee) { }
            this.toastr.error('File size is too Large, Maximum 5 mb Allowed', '', {
                timeOut: 3000,
                positionClass: 'toast-top-right',
                progressBar: true,
                progressAnimation: 'increasing'
            });
        }
        else {
            this.uploadSrv.saveimage(file).subscribe((data) => {
                console.log('data', data);
                this.formObj.w9_form.url = data.file;
                this.formObj.w9_form.document_name = file.name;
            }, error => {
                console.log('error');
            });
        }
    }
    clearForm() {
        this.formObj._id = '';
        this.formObj.bus_name = '';
        this.formObj.business_type = '';
        this.formObj.noOfStores = '';
        this.formObj.gstNumber = '';
        this.formObj.vatNumber = '';
        this.formObj.business_Tax_Id = '';
        this.formObj.w9_form.url = '';
        this.formObj.w9_form.document_name = '';
    }
    dynamicSort(property) {
        var sortOrder = 1;
        if (property[0] === "-") {
            sortOrder = -1;
            property = property.substr(1);
        }
        return function (a, b) {
            if (sortOrder == -1) {
                return b[property].localeCompare(a[property]);
            }
            else {
                return a[property].localeCompare(b[property]);
            }
        };
    }
